import {
  BrowserRouter as Router,
  Route
} from 'react-router-dom';
import './App.css';
import FrontPage from './pages/FrontPage.js'
import AboutPage from './pages/AboutPage.js'
function App() {
  return (
    <Router>
      <Route path="/" exact component={FrontPage}/>
      <Route path="/about" component={AboutPage}/>
    </Router>
  );
}

export default App;
